{
  "openapi": "3.0.3",
  "info": {
    "title": "Hypixel Public API",
    "description": "# Introduction\n This is the official Hypixel API documentation.\n [Hypixel Website](https://hypixel.net/) - [GitHub Repo](https://github.com/HypixelDev/PublicAPI) - [API Help Forum](https://hypixel.net/forums/api-help.111/)\n## Limits\n API keys have a default rate limit of 120 requests per minute. If you require a higher limit please contact us via our support desk with an explanation for the increased limit and your Minecraft Account UUID.\n Any abuse of the API or intentions to bypass this limit (such as with multiple API keys) will lead to your API key being reset or banned.\n## GameTypes\n | ID | Type Name      | Database Name | Clean Name           |\n |----|----------------|---------------|----------------------|\n | 2  | QUAKECRAFT     | Quake         | Quake                |\n | 3  | WALLS          | Walls         | Walls                |\n | 4  | PAINTBALL      | Paintball     | Paintball            |\n | 5  | SURVIVAL_GAMES | HungerGames   | Blitz Survival Games |\n | 6  | TNTGAMES       | TNTGames      | TNT Games            |\n | 7  | VAMPIREZ       | VampireZ      | VampireZ             |\n | 13 | WALLS3         | Walls3        | Mega Walls           |\n | 14 | ARCADE         | Arcade        | Arcade               |\n | 17 | ARENA          | Arena         | Arena                |\n | 20 | UHC            | UHC           | UHC Champions        |\n | 21 | MCGO           | MCGO          | Cops and Crims       |\n | 23 | BATTLEGROUND   | Battleground  | Warlords             |\n | 24 | SUPER_SMASH    | SuperSmash    | Smash Heroes         |\n | 25 | GINGERBREAD    | GingerBread   | Turbo Kart Racers    |\n | 26 | HOUSING        | Housing       | Housing              |\n | 51 | SKYWARS        | SkyWars       | SkyWars              |\n | 52 | TRUE_COMBAT    | TrueCombat    | Crazy Walls          |\n | 54 | SPEED_UHC      | SpeedUHC      | Speed UHC            |\n | 55 | SKYCLASH       | SkyClash      | SkyClash             |\n | 56 | LEGACY         | Legacy        | Classic Games        |\n | 57 | PROTOTYPE      | Prototype     | Prototype            |\n | 58 | BEDWARS        | Bedwars       | Bed Wars             |\n | 59 | MURDER_MYSTERY | MurderMystery | Murder Mystery       |\n | 60 | BUILD_BATTLE   | BuildBattle   | Build Battle         |\n | 61 | DUELS          | Duels         | Duels                |\n | 63 | SKYBLOCK       | SkyBlock      | SkyBlock             |\n | 64 | PIT            | Pit           | Pit                  |\n | 65 | REPLAY         | Replay        | Replay               |\n | 67 | SMP            | SMP           | SMP                  |\n\n### Storage\n Games store their respective stats and data in a Player's `stats` collection. The game's specific data is held within a JSON object named after it's `Database Name` (seen above.)\n### Notes\n * Clean names are what is displayed to the user when referencing the name.\n * Database names or IDs are used when the API references a specific GameType.\n## Other Notes\n\n### Date and Time\n Generally dates are stored as a Unix Epoch times in milliseconds.\n\n### Response Format\n Responses are served in JSON format.\n\n### UUID Parameters\n All uuid parameters support both dashed and undashed versions.\n\n### SkyBlock items and inventories\n Items and inventory data are stored as a base64 encoded string containing gzipped nbt data.\n If a method is missing important information about an item or inventory, you should try checking this!\n >Note: the base64 string may contain a unicode escape for non-alphabetical symbols, and some programming languages may have silent defects when interpreting the string. \n\n# Authentication\n\n<!-- ReDoc-Inject: <security-definitions> -->",
    "version": "v1",
    "contact": {
      "name": "Hypixel Support",
      "url": "https://support.hypixel.net",
      "email": "support@hypixel.net"
    }
  },
  "servers": [
    {
      "url": "https://api.hypixel.net"
    }
  ],
  "components": {
    "securitySchemes": {
      "ApiKey": {
        "type": "apiKey",
        "in": "header",
        "name": "API-Key",
        "description": "Can be obtained by joining the Minecraft server `mc.hypixel.net` and using the command `/api`."
      }
    },
    "responses": {
      "DataMissing": {
        "description": "Some data is missing, this is usually a field.",
        "content": {
          "application/json": {
            "schema": {
              "type": "object",
              "properties": {
                "success": {
                  "type": "boolean",
                  "example": false
                },
                "cause": {
                  "type": "string",
                  "example": "Missing one or more fields [...]"
                }
              }
            }
          }
        }
      },
      "InvalidKey": {
        "description": "Access is forbidden, usually due to an invalid API key being used.",
        "content": {
          "application/json": {
            "schema": {
              "type": "object",
              "properties": {
                "success": {
                  "type": "boolean",
                  "example": false
                },
                "cause": {
                  "type": "string",
                  "example": "Invalid API key"
                }
              }
            }
          }
        }
      },
      "RateLimited": {
        "description": "A request limit has been reached, usually this is due to the limit on the key being reached but can also be triggered by a global throttle.",
        "content": {
          "application/json": {
            "schema": {
              "type": "object",
              "properties": {
                "success": {
                  "type": "boolean",
                  "example": false
                },
                "cause": {
                  "type": "string",
                  "example": "Key throttle"
                },
                "throttle": {
                  "type": "boolean",
                  "example": true
                },
                "global": {
                  "type": "boolean",
                  "description": "When this boolean exists and is true, the throttle occurring is a global throttle applied to all users",
                  "example": true
                }
              }
            }
          }
        }
      },
      "InvalidPage": {
        "description": "The page provided is invalid.",
        "content": {
          "application/json": {
            "schema": {
              "type": "object",
              "properties": {
                "success": {
                  "type": "boolean",
                  "example": false
                },
                "cause": {
                  "type": "string",
                  "example": "Invalid page"
                }
              }
            }
          }
        }
      },
      "MissingPage": {
        "description": "The page provided does not exist.",
        "content": {
          "application/json": {
            "schema": {
              "type": "object",
              "properties": {
                "success": {
                  "type": "boolean",
                  "example": false
                },
                "cause": {
                  "type": "string",
                  "example": "Page not found"
                }
              }
            }
          }
        }
      },
      "MalformedData": {
        "description": "Some data provided is invalid.",
        "content": {
          "application/json": {
            "schema": {
              "type": "object",
              "properties": {
                "success": {
                  "type": "boolean",
                  "example": false
                },
                "cause": {
                  "type": "string",
                  "example": "Malformed UUID"
                }
              }
            }
          }
        }
      },
      "NotPopulated": {
        "description": "The data is not yet populated and should be available shortly",
        "content": {
          "application/json": {
            "schema": {
              "type": "object",
              "properties": {
                "success": {
                  "type": "boolean",
                  "example": false
                },
                "cause": {
                  "type": "string",
                  "example": "Leaderboard data has not yet been populated"
                }
              }
            }
          }
        }
      }
    },
    "schemas": {
      "Booster": {
        "properties": {
          "_id": {
            "type": "string",
            "format": "objectid"
          },
          "purchaserUuid": {
            "type": "string",
            "format": "uuid",
