          "amount": {
            "type": "number"
          },
          "originalLength": {
            "type": "integer"
          },
          "length": {
            "type": "integer"
          },
          "gameType": {
            "type": "integer"
          },
          "dateActivated": {
            "type": "integer",
            "format": "int64"
          }
        }
      },
      "ActiveBooster": {
        "allOf": [
          {
            "$ref": "#/components/schemas/Booster"
          },
          {
            "type": "object",
            "properties": {
              "stacked": {
                "type": "array",
                "nullable": true,
                "items": {
                  "type": "string",
                  "description": "UUID of the player in a dashed format",
                  "format": "uuid",
                  "example": "ad8fefaa-8351-454b-b739-a4eaa872173f"
                }
              }
            }
          }
        ]
      },
      "QueuedBooster": {
        "allOf": [
          {
            "$ref": "#/components/schemas/Booster"
          },
          {
            "type": "object",
            "properties": {
              "stacked": {
                "type": "boolean",
                "nullable": true
              }
            }
          }
        ]
      },
      "SkyBlockAuction": {
