            "type": "string",
            "format": "objectid"
          },
          "uuid": {
            "type": "string",
            "format": "uuid"
          },
          "auctioneer": {
            "type": "string",
            "format": "uuid"
          },
          "profile_id": {
            "type": "string",
            "format": "uuid"
          },
          "coop": {
            "type": "array",
            "items": {
              "type": "string",
              "format": "uuid"
            }
          },
          "start": {
            "type": "number",
            "format": "int64"
          },
          "end": {
            "type": "number",
            "format": "int64"
          },
          "item_name": {
            "type": "string"
          },
          "item_lore": {
            "type": "string"
          },
          "extra": {
            "type": "string"
          },
          "category": {
            "type": "string"
          },
          "tier": {
            "type": "string"
          },
          "starting_bid": {
            "type": "number"
          },
          "item_bytes": {
            "type": "object",
            "properties": {
              "type": {
                "type": "number"
              },
              "data": {
                "type": "string"
              }
            }
          },
          "claimed": {
            "type": "boolean"
          },
          "claimed_bidders": {
            "type": "array"
          },
          "highest_bid_amount": {
            "type": "number"
          },
          "bids": {
            "type": "array",
            "items": {
              "type": "object",
              "properties": {
                "auction_id": {
                  "type": "string",
                  "format": "uuid"
