                "bidder": {
                  "type": "string",
                  "format": "uuid"
                },
                "profile_id": {
                  "type": "string",
                  "format": "uuid"
                },
                "amount": {
                  "type": "number"
                },
                "timestamp": {
                  "type": "number",
