              "timestamp": 1573760824844
            }
          ]
        }
      },
      "SkyBlockProfile": {
        "properties": {
          "profile_id": {
            "type": "string",
            "format": "uuid"
          },
          "members": {
            "type": "object"
          },
          "community_upgrades": {
            "nullable": true,
            "type": "object"
          },
          "cute_name": {
            "type": "string"
          },
          "banking": {
            "nullable": true,
            "type": "object"
          },
          "game_mode": {
            "nullable": true,
            "type": "string"
          }
        }
      },
      "SkyBlockItem": {
        "properties": {
          "id": {
            "description": "The unique identifier for this item",
            "type": "string"
          },
          "material": {
            "description": "The Bukkit material enum value for the item",
            "type": "string"
          },
          "name": {
            "description": "The name of the item",
            "type": "string"
          },
          "tier": {
            "description": "The rarity tier of the item",
            "type": "string",
            "enum": [
              "COMMON",
              "UNCOMMON",
              "RARE",
              "EPIC",
              "LEGENDARY",
              "MYTHIC",
              "SUPREME",
              "SPECIAL",
              "VERY_SPECIAL"
            ]
          },
          "color": {
            "description": "The color metadata to be applied to an item, usually leather armor pieces",
            "pattern": "^(?:(?:^|,\\s*)([01]?\\d\\d?|2[0-4]\\d|25[0-5])){3}$",
            "type": "string"
          },
          "skin": {
            "description": "The skin value for a skull based item",
            "type": "string"
          }
        },
        "example": {
          "material": "LEATHER_CHESTPLATE",
          "color": "255,215,0",
          "name": "Farm Armor Chestplate",
          "category": "CHESTPLATE",
          "tier": "RARE",
          "stats": {
            "DEFENSE": 75,
            "HEALTH": 20
          },
          "npc_sell_price": 5200,
          "id": "FARM_ARMOR_CHESTPLATE"
        }
      },
      "Game": {
        "description": "Information about a specific game. When a field is not present you should fallback to the provided default if there is one, required fields will always exist.",
        "required": [
          "id",
          "name",
          "databaseName"
        ],
        "properties": {
          "id": {
            "type": "integer",
            "description": "The backend ID of the game.",
            "example": 1
          },
          "name": {
            "type": "string",
            "description": "The display name of the game.",
            "example": "Bed Wars"
          },
          "databaseName": {
            "type": "string",
            "description": "The key used for database storage, such as for stats.",
            "example": "Bedwars"
          },
          "modeNames": {
            "type": "object",
            "description": "A map of mode key to display name",
            "example": {
              "solo_normal": "Solo",
              "team_normal": "Doubles"
            }
          },
          "retired": {
            "type": "boolean",
            "description": "True if the game is retired and no longer playable.",
            "default": false
          },
          "legacy": {
            "type": "boolean",
            "description": "True if the game is legacy and part of the Classic Lobby.",
            "default": false
          }
        },
        "example": {
          "id": 58,
          "name": "Bed Wars",
          "databaseName": "Bedwars",
          "modeNames": {
            "BEDWARS_TWO_FOUR": "4v4",
            "BEDWARS_EIGHT_ONE": "Solo"
          }
        }
      }
    }
  },
  "paths": {
    "/key": {
      "get": {
        "tags": [
          "API"
        ],
        "summary": "API Key Information",
        "security": [
          {
            "ApiKey": []
          }
        ],
        "responses": {
          "200": {
            "description": "Get key information",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": true
                    },
                    "record": {
                      "type": "object",
                      "properties": {
                        "key": {
                          "type": "string",
                          "format": "uuid"
                        },
                        "owner": {
                          "type": "string",
                          "format": "uuid"
                        },
                        "limit": {
                          "type": "integer",
                          "default": 120
                        },
                        "queriesInPastMin": {
                          "type": "integer"
                        },
                        "totalQueries": {
                          "type": "number"
                        }
                      }
                    }
                  }
                }
              }
            }
          },
          "403": {
            "$ref": "#/components/responses/InvalidKey"
          },
          "429": {
            "$ref": "#/components/responses/RateLimited"
          }
        }
      }
    },
    "/player": {
      "get": {
        "summary": "Data of a specific player, including game stats",
        "tags": [
          "Player Data"
        ],
        "security": [
          {
            "ApiKey": []
          }
        ],
        "parameters": [
          {
            "in": "query",
            "name": "uuid",
            "schema": {
              "type": "string"
            },
            "required": true
          }
        ],
        "responses": {
          "200": {
            "description": "Get player's data",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": true
                    },
                    "player": {
                      "type": "object",
                      "properties": {
                        "uuid": {
                          "type": "string",
                          "example": "3fa85f6457174562b3fc2c963f66afa6"
                        },
                        "displayname": {
                          "type": "string",
                          "nullable": true
                        },
                        "rank": {
                          "type": "string",
                          "nullable": true,
                          "enum": [
                            "ADMIN",
                            "MODERATOR",
                            "HELPER",
                            "NORMAL"
                          ]
                        },
                        "packageRank": {
                          "type": "string",
                          "nullable": true,
                          "enum": [
                            "MVP_PLUS",
                            "MVP",
                            "VIP_PLUS",
                            "VIP",
                            "NONE"
                          ]
                        },
                        "newPackageRank": {
                          "type": "string",
                          "nullable": true,
                          "enum": [
                            "MVP_PLUS",
                            "MVP",
                            "VIP_PLUS",
                            "VIP",
                            "NONE"
                          ]
                        },
                        "monthlyPackageRank": {
                          "type": "string",
                          "nullable": true,
                          "enum": [
                            "SUPERSTAR",
                            "NONE"
                          ]
                        },
                        "firstLogin": {
                          "type": "number",
                          "nullable": true
                        },
                        "lastLogin": {
                          "type": "number",
                          "nullable": true
                        },
                        "lastLogout": {
                          "type": "number",
                          "nullable": true
                        },
                        "stats": {
                          "type": "object",
                          "nullable": true
                        }
                      }
                    }
                  }
                }
              }
            }
          },
          "400": {
            "$ref": "#/components/responses/DataMissing"
          },
          "403": {
            "$ref": "#/components/responses/InvalidKey"
          },
          "429": {
            "$ref": "#/components/responses/RateLimited"
          }
        }
      }
    },
