                      "type": "boolean"
                    },
                    "uuid": {
                      "type": "string",
                      "format": "uuid",
                      "example": "ad8fefaa8351454bb739a4eaa872173f"
                    },
                    "records": {
                      "type": "array",
                      "items": {
                        "type": "object",
